import styled from 'styled-components';

export const Sections = styled.section`
  display: flex;
  flex-direction: column;
  justify-content: center;
  width: 100%;
  padding: 0 3rem;
  border-bottom: 1px solid #f3f4f5;
  padding-top: 1.8rem;
`;
